import styled from 'styled-components'

export const Container = styled.div`
    width: 100%;
    height: 40px;
    margin-top: 50px;
    background: rgba(52, 69, 225, 0.76);
    border-top: 3px solid #893DCC;
    position: fixed;
    bottom: 0;
    left: 0;
`
